"use strict";

var SIMCONTAINER = "#kinaseSimBarplot"
var aspectRatio = 2.5;
var showncondition = 80;
var margin = {top: 60, right: 30, bottom: 10, left: 30};
var barResizeFactor = 3;

var width;
var height;
var xsim;
var ysim;
var xsimAxis;

function drawShinySimilar(data){
    width = ($("#submitForm").width()/2)-50;
    height = width * aspectRatio;

    var el=SIMCONTAINER;
    
    var simsvg = d3.select(el).append("svg")
        .attr("width", width)
        .attr("height", height)
        .append("g")
        .attr("id", "simchartsvg")
        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    xsim=d3.scale.linear()
        .range([0, width - margin.left - margin.right]);

    ysim=d3.scale.ordinal()
        .rangeRoundBands([0, height - margin.top - margin.bottom], .2);

    xsimAxis=d3.svg.axis()
        .scale(xsim)
        .orient("top");

    data = $.grep(data, function(d) {
        return d.R != "NA";
    });

    data.forEach(function(d) {
        if(d.R == "NA"){
            d.R = 0;
        }else{
            d.R = +d.R;
        }
    });

    data = data.slice(1,(showncondition/2)).concat(data.slice(data.length - (showncondition/2) , data.length))
    var test = data
    xsim.domain(d3.extent(data, function(d) { return d.R; })).nice();
    ysim.domain(data.map(function(d) { return d.conditionid; }));
    
    var bar = simsvg.selectAll(".bar")
        .data(data)
        .enter().append("g")
        .attr('main', function(d) {return d.conditionid})
        .attr("class", function(d) { return d.R < 0 ? "bar negative" : "bar positive"; })
        .attr("x", function(d) { xsim(Math.min(0, d.R)) })
        .attr("transform", function(d, i) { return "translate("+xsim(Math.min(0, d.R))+"," + ysim(d.conditionid) + ")"; })
    
    bar.append("rect")
        .attr("height", ysim.rangeBand())
        .attr("width",  function(d) { return Math.abs(xsim(d.R) - xsim(0)) })


    bar.append("text")
        .attr("class", "barlabels")
        .attr("text-anchor", function(d) { return d.R > 0 ? "end" : "start" })
        .attr("x", function(d) { return d.R > 0 ? Math.abs(xsim(d.R) - xsim(0)) - 3 : 3 })
        .attr("y", ysim.rangeBand() / 2)
        .attr("dy", ".35em")
        .style("font-size", function(d) { return ysim.rangeBand() + "px"; })
        .text(function(d, i) { return d.description });

    simsvg.append("g")
        .attr("class", "x axis")
        .append("text")
        .attr("class", "x label")
        .attr("text-anchor", "middle")
        .attr("x", (width-margin.left-margin.right)/2)
        .attr("y", -30)
        .text("Correlated Conditions");

    simsvg.append("g")
        .attr("class", "y axis")
        .append("line")
        .attr("x1", xsim(0))
        .attr("x2", xsim(0))
        .attr("y2", height);

    simsvg.append("g")
        .attr("class","halfaxis")
        .append("line")
        .attr("x1",  xsim(Math.min.apply(Math, $.map(test, function (d){return d.R}))))
        .attr("x2",  xsim(Math.max.apply(Math, $.map(data, function (d){return d.R}))))
        .attr("y1", (height-margin.top)/2 - (ysim.rangeBand()))
        .attr("y2", (height-margin.top)/2 - (ysim.rangeBand()));    

    simsvg.select(".x.axis") // change the x axis
        .call(xsimAxis);
}

