// Checks if file storage is available
function storageAvailable(type){
    try {
        var storage = window[type], x = '__storage_test__';
        storage.setItem(x, x);
        storage.removeItem(x);
        return true;
    }
    catch(e) {
        return false;
    }
}

// HTML5 feature to read files
function handleFiles(files) {
    // Check for the various File API support.
    if (window.FileReader) {
        getAsText(files[0]);
    } else {
        alert('FileReader are not supported in this browser.');
    }
}

function getAsText(fileToRead) {
    var reader = new FileReader();
    // Read file into memory as UTF-8      
    reader.readAsText(fileToRead);
    // Handle errors load
    reader.onload = loadHandler;
    reader.onerror = fileErrorHandler;
}

function loadHandler(event) {
    var csv = event.target.result;
    $("#inputtext").val(csv);
    $('#inputtext').trigger("change");
    // processData(csv);
}


function fileErrorHandler(evt) {   
    if(evt.target.error.name == "NotReadableError") {
        showError("The file is not readable");
    }    
}

function showError(list){
    var msglist = $("<ul />");
    for(var i = 0; i < list.length; i++) {
        var errormsg = list[i];
        var msgtag = $("<li />").html(errormsg);
        msglist.append(msgtag);
    }
    window.onbeforeunload = null; //Disable the message

    $(".modal-body").empty();
    $(".modal-body").append(msglist);
    $('#errorModal').modal('toggle')
}

function runAnalysis(){
    if(!checkData($("#inputtext").val(),
                  $('input[name=sep]:checked').val(),
                  $(".bootstrap-switch").hasClass("bootstrap-switch-on"),
                  $('input[name=quote]:checked').val())){
        return(false);
    } 
    
    readData()
}

function checkData(text,splitchar,header,quotes){
    var allTextLines;
    var errorlist = [];
    var lines = [];
    var startingLine;

    window.text = text;
    
    var res = text.match(/\r\n|\n/g);
    window.res = res;

    if(res){
        allTextLines = text.split(/\r\n|\r|\n/g);;
    }else{
        allTextLines = [];
    }
    
    if(header == true){
        startingLine=1;
    }else{
        startingLine=0;
    }
    if(allTextLines.length <50){
        errorlist.push("Too few phosphosite quantifications. Please check the format is correct and you have enough phosphosite quantifications")
    }else{
        for (var i=startingLine; i<startingLine+5; i++) {
            var data = allTextLines[i].split(splitchar);
            if(data.length != 3){
                errorlist.push("The data should contain 3 columns seperated by the Field Separator specified in the File Format Options.")
            }
            if(!isNaN(parseInt(data[0]))){
                errorlist.push("The first column should contain the Protein ID (Uniprot)")
            }
            if(isNaN(parseInt(data[1]))){
                errorlist.push("The second column should contain the Phosphosite Position");
            }
            if(isNaN(parseFloat(data[2]))){
                errorlist.push("The third column should contain the Fold Change (log2) of the phosphosite");
            }
        }
    }
    var uniqueerrors=errorlist.filter(function(itm,i,a){
        return i==errorlist.indexOf(itm);
    });

    if(uniqueerrors.length > 0){
        showError(uniqueerrors);
        return(0)
    }else{
        return(1);
    }
}

function parseCSV(i,callback){
    callback(null, d3.csv.parseRows(i))
}

function readData() {
    d3_queue.queue()
        .defer(d3.json, 'data/kinase_substrates_uniprot.json')
        .defer(parseCSV, $("#inputtext").val())
        .defer(d3.json, 'data/complexes.json')    
        .await(analyzeData);
}

function analyzeData(error, substrates, dataset ,complexes){
    if(error) { console.log(error); }
    $("#submitForm").hide();
    $("#progressContainer").show();

    totalProgress=Object.keys(substrates).length + Object.keys(complexes).length;
    progressCounter=(1/totalProgress)*100;
    //$('.progress-message').html("Analyzing Regulatory Data");

    // long running tasks
    d3_queue.queue()
        .defer(batchKSEA, dataset, substrates)
        .defer(getComplexRegulation, dataset, complexes)
        .defer(d3.json, 'data/activities.json')
        .defer(d3.json, 'data/sample_descriptions.json')
        .awaitAll(finishedResults);

    // avoid waiting times
    // d3_queue.queue()
    //     .defer(d3.json, '/data/results.json')
    //     .defer(d3.json, '/data/complexresults.json')
    //     .defer(d3.json, '/data/activities.json')
    //     .defer(d3.json, '/data/sample_descriptions.json')
    //     .awaitAll(finishedResults);

}

function finishedResults(error, results){
    window.onbeforeunload = null; //Disable the message
    if(error) { console.log(error); }

    var cachedResults=false;
    if(results.length == 1){
        results=results[0];
        cachedResults=true;
    }

    var KSEAresults = results[0] || results["KSEAresults"];
    var complexRegulation = results[1] || results["complexRegulation"];
    var conditionActivities = results[2] || results["conditionActivities"];
    var sampleDescriptions = results[3] || results["sampleDescriptions"];
    
    KSEAresults.forEach(function(d){
        d.activity = +d.activity;
        d.ES = +d.ES;
    })

    complexRegulation.forEach(function(d){
        d.activity = +d.activity;
    })
    
    var activityCorrelations = getActivityCorrelations(KSEAresults,conditionActivities,sampleDescriptions);
    window.KSEAresults = KSEAresults;
    window.complexRegulation = complexRegulation;
    window.activityCorrelations = activityCorrelations;

    var resultsObject = {
        "KSEAresults": KSEAresults,
        "complexRegulation":complexRegulation,
        "conditionActivities":conditionActivities,
        "sampleDescriptions":sampleDescriptions
    }

    if(cachedResults){
        displayResults(KSEAresults,activityCorrelations,complexRegulation);
        $(".queryelements").fadeOut(300,function(){
            $("#cachedResultsContainer").fadeIn(500);
        });
    }else{
        if(! results["KSEAresults"]){
            if(storageAvailable('localStorage')){
                saveInLocalStorage(resultsObject);
            }else{
                alert("This job will not be stored in your local computer.\n\nIf you want to save your Phosfate jobs for later disable Private Browsing");
            }
        }
        displayResults(KSEAresults,activityCorrelations,complexRegulation);
        $("#progressContainer").fadeOut(300,function(){
            $("#resultsContainer").fadeIn(500);                
        });
    }

}

function saveInLocalStorage(obj){
    var allresultskeys = Object.keys(localStorage);
    if(allresultskeys.length > 4){
      var phosfatecaches = jQuery.grep(Object.keys(localStorage), function(d) {return d.substring(0,8) == "phosfate"}).sort();
      localStorage.removeItem(phosfatecaches.pop());
    }
    
    var timestamp = new Date().getTime();

    var toinsert = true;
    while(toinsert){
        //Saves in local storage or throws error
        try{
            var result = localStorage.setItem("phosfate_" + timestamp, JSON.stringify(obj));
            toinsert = false;
        } catch(e){
            console.log(e.message);
            var phosfatecaches = jQuery.grep(Object.keys(localStorage), function(d) {return d.substring(0,8) == "phosfate"}).sort();
            localStorage.removeItem(phosfatecaches.pop());
            toinsert=true;
            if(jQuery.grep(Object.keys(localStorage), function(d) {return d.substring(0,8) == "phosfate"}).length == 0){
                toinsert=false;
                console.log("Data too big for localStorage");
            }
        }
    }
}

function getComplexRegulation(dataset, complexes, callback){
    
    dataset = dataset.filter(function(d) { return !isNaN(parseInt(d[2])) });

    dataset.sort(function(x, y){
        return d3.descending(parseFloat(x[2]), parseFloat(y[2]));
    })

    RANKING_ZEROS= makeArrayOf(0, dataset.length);
    RANKING_ONES = makeArrayOf(1, dataset.length);

    var ranking_keys = dataset.map(function(d,i){return(d[0]+"_"+d[1])});;
    var ranking_proteins = dataset.map(function(d,i){return(d[0])});;
    
    var ranking = {}
    for(i=0; i<dataset.length; i++){
        ranking[ranking_keys[i]] = i
    }
    var sitesInProtein = {};
    for(i=0; i<dataset.length; i++){
        if(!sitesInProtein[ranking_proteins[i]]){
            sitesInProtein[ranking_proteins[i]] = [];
        }
        sitesInProtein[ranking_proteins[i]].push(ranking_keys[i]);
    }
    
    var norm_express = dataset.map(function(d,i){return(parseFloat(d[2]))});

    var t0 = performance.now();
    
    // Only quantified substrates
    for(var k = 0; k < complexes.length; k++) {
        var thiscomplex = complexes[k].id;
        var thisproteins = complexes[k].uniprot;
        for(var s = 0; s < thisproteins.length; s++) {
            if(s == 0){
                complexes[k].quantified=[];
            }
            var sitesInThisProtein = sitesInProtein[thisproteins[s]];
            if(sitesInThisProtein){
                complexes[k].quantified = sitesInThisProtein;
            }else{
                complexes[k].quantified = [];
            }
        }
    }

    // complexes = complexes.filter(function(d){return(d.quantified.length)});
    var complexesResults = [];
    var i = 0;
    (function complexKSEAasync() {
        // var kinase = allkinases[i];
        var thiscomplex = complexes[i];
        $('.progress .progress-bar').attr("data-transitiongoal",progressCounter).progressbar({display_text: 'fill',
                                                                                              use_percentage: true,
                                                                                              transition_delay: 500});
        progressCounter = progressCounter + (1/totalProgress) * 100;

        var signature = thiscomplex.quantified;
        var thisresult = ksea(ranking,ranking_keys,norm_express,signature,true,trial);
               
        thisresult.id = thiscomplex.id;
        thisresult.name = thiscomplex.name;
        thisresult.quantSites = signature.length;
        thisresult.proteins = thiscomplex.uniprot.length;
        if(thisresult.ES > 0){
            thisresult.activity = Math.log10(thisresult.pvalue) * -1;
        }else if(thisresult.ES < 0){
            thisresult.activity = Math.log10(thisresult.pvalue);
        }else{
            thisresult.activity = NaN;
        }
        complexesResults.push(thisresult);
        i++;
        
        if (i < complexes.length) {
            setTimeout(complexKSEAasync, 0);
        }else{
            var t1 = performance.now();
            console.log("Complexes 1000 iterations Complexes All: " + (t1 - t0) + " milliseconds.")
            callback(null,complexesResults)
        }
    })();

}



function batchKSEA(dataset,substrates,callback){
    // Order dataset
    dataset.sort(function(x, y){
        return d3.descending(parseFloat(x[2]), parseFloat(y[2]));
    })

    //Filter missing values
    dataset = dataset.filter(function(d) { return !isNaN(parseInt(d[2])) });

    RANKING_ZEROS= makeArrayOf(0, dataset.length);
    RANKING_ONES = makeArrayOf(1, dataset.length);
    
    var ranking_keys = dataset.map(function(d,i){return(d[0]+"_"+d[1])});;
    var ranking = {}
    for(i=0; i<dataset.length; i++){
        ranking[ranking_keys[i]] = i
    }
    var norm_express = dataset.map(function(d,i){return(parseFloat(d[2]))});

    var t0 = performance.now();
    var KSEAresults = [];
    var allkinases = Object.keys(substrates);

    // Only quantified substrates
    var x={};
    for(var k = 0; k < allkinases.length; k++) {
        var thiskinase = allkinases[k];
        var thissubstrates = substrates[thiskinase];
        for(var s = 0; s < thissubstrates.length; s++) {
            if(s == 0){
                x[thiskinase]=[];
            }
            if(ranking[thissubstrates[s]]){
                x[thiskinase].push(thissubstrates[s]);
            }
        }
    }
    substrates = x;
    window.substrates = substrates;
    
    var i = 0;
    (function kinaseKSEAasync() {
        var kinase = allkinases[i];

        $('.progress .progress-bar').attr("data-transitiongoal",progressCounter).progressbar({display_text: 'fill',
                                                                                              use_percentage: true,
                                                                                              transition_delay: 500});
        progressCounter = progressCounter + (1/totalProgress)*100;

        
        var signature = substrates[kinase];                               
        var thisresult = ksea(ranking,ranking_keys,norm_express,signature,true,trial);
        
        thisresult.kinase = kinase;
        thisresult.substrates = signature.length;
        if(thisresult.ES > 0){
            thisresult.activity = Math.log10(thisresult.pvalue) * -1;
        }else if(thisresult.ES < 0){
            thisresult.activity = Math.log10(thisresult.pvalue);
        }else{
            thisresult.activity = NaN;
        }
        KSEAresults.push(thisresult);
        i++;
        
        if (i < allkinases.length) {
            setTimeout(kinaseKSEAasync, 0);
        }else{
            var t1 = performance.now();
            console.log("KSEA 1000 iterations All: " + (t1 - t0) + " milliseconds.")
            callback(null,KSEAresults);
        }
    })();
    
}

function getActivityCorrelations(KSEAresults,conditionActivities,sampleDescriptions){
    var results = [];
    
    var KSEAresults_nonNA = KSEAresults.filter(function(d) {return parseFloat(d.ES)});
    KSEAkinases = KSEAresults_nonNA.map(function(d){ return d.kinase});

    var KSEAactivities={};
    var KSEAkinases = [];
    for(var i = 0; i < KSEAresults_nonNA.length; i++) {
        var thisentry = KSEAresults_nonNA[i];
        if(parseFloat(thisentry.ES)){
            KSEAkinases.push(thisentry.kinase);
            KSEAactivities[thisentry.kinase]  = parseFloat(thisentry.activity);
        }
    }
    
    var conditionnames = Object.keys(conditionActivities);
    for(var i = 0; i < conditionnames.length; i++) {
        var thiscondition = conditionnames[i];
        var thisresult = {};
        var KSEAvector = [];
        var conditionVector = [];
        for(var k = 0; k < KSEAkinases.length; k++) {
            var thiskinase = KSEAkinases[k];
            var thisconditionAct = conditionActivities[thiscondition][thiskinase.toUpperCase()];
            if(thisconditionAct){
                KSEAvector.push(KSEAactivities[thiskinase]);
                conditionVector.push(thisconditionAct)
            }
        }

        thisresult["conditionid"] = thiscondition;
        thisresult["description"] = sampleDescriptions[thiscondition];
        if(conditionVector.length > 2){
            var lm = new Regression.linear(new Vector(KSEAvector), new Vector(conditionVector));
            var R = Math.sqrt(lm.rs);
            if(lm.slope < 0){
                R = R*-1;
            }
            thisresult["common"] = lm.n;
            thisresult["R"] = R;
            if(lm.slope_p > 1){
                lm.slope_p = 1;
            }
            thisresult["pvalue"] = lm.slope_p;
        }
        results.push(thisresult);        
    }
    return(results);
}


