var seed = 1;

// seeded random number generator
function myrandom() {
    var x = Math.sin(seed++) * 10000;
    return x - Math.floor(x);
}

//It takes a sample of an array of elements. Much more efficient than the underscore.js _sample
function sampleArray(arr, size){
    var rnd_arr = new Array(size);
    var picked = {}
    var c = 0;
    while(c < size){
        var rand_index = Math.floor(myrandom()*arr.length)
        if(picked[rand_index]) continue;
        picked[rand_index] = 1
        rnd_arr[c] = arr[ rand_index ]
        c++
    }
    return rnd_arr
}

//Clones an array
Array.prototype.clone = function() {
    return this.slice(0);
};

// Creates and array of "value" with a given "length"
function makeArrayOf(value, length) {
  arr = new Array(length)
  for(i=0; i<length; i++) arr[i] = value
  return arr;
}


function ksea(ranking,ranking_keys,norm_express,signature,significance,trial){
    var ranking_length = norm_express.length;

    var result = {};
    result["substrates"] = signature.length;

    if(signature.length == 0){
        result["substrates"] = 0;
        result["ES"] = NaN;
        if(significance){
            result["pvalue"]= NaN;
        }
        return(result);        
    }
    

    var N = ranking_length;
    var N_Nh = ranking_length - signature.length;

    // CLONE
    var hitCases = RANKING_ZEROS.clone();
    var R = RANKING_ZEROS.clone();
    var missCasses = RANKING_ONES.clone();

    for(var i = 0; i < signature.length; i++) {
        r_index = ranking[signature[i]]
        if( r_index ){
             missCasses[r_index] = 0
             R[r_index] = Math.abs( norm_express[r_index] )
        }
    }

    // Cumsum + maximum
    var NR = -Infinity
    for(var i = 0; i < ranking_length; i++) {
        if(i != 0){
            hitCases[i] = R[i] + hitCases[i-1]
            missCasses[i] = missCasses[i] + missCasses[i-1]
        }

        if(hitCases[i] > NR) NR = hitCases[i]   
    }

    var RS_max = -Infinity
    var RS_max_index = null

    for(var i = 0; i < ranking_length; i++) {
        hitCases[i]     /= NR 
        missCasses[i]   /= N_Nh

        tmp = Math.abs( hitCases[i] - missCasses[i] )
        if(tmp > RS_max){
            RS_max = tmp
            RS_max_index = i
        }
    }
    
    if(NR === 0){
        result["ES"] = NaN;
        if(significance){
            result["pvalue"]=NaN;
        }
        return(result);        
    };

    var ES = hitCases[RS_max_index] - missCasses[RS_max_index];

    result["ES"]=ES;

    if(significance){
        var EMPES = (function computeSimpleEMPES(){
            var ES = [];
            for(var i = 0; i < trial; i++) {
                var shuffled_signature = sampleArray(ranking_keys, signature.length);
                ES.push(ksea(ranking,ranking_keys,norm_express,shuffled_signature,false,trial))
            }
            return(ES)
        })();

        // EMPES = computeSimpleEMPES(ranking,norm_express,signature,trial) //Calculate ES trial number of times by sampling
        
        if(ES >= 0){
            P = EMPES.filter(function(d) { return d.ES >= ES; }).length / trial
        }else{
            P = EMPES.filter(function(d) { return d.ES <= ES; }).length / trial
        }
        if(P === 0){
            P = 1/trial;
        }
        result["pvalue"]=P;
    }
    return(result);
}


function ConvertToCSV(objArray) {
    var array = typeof objArray != 'object' ? JSON.parse(objArray) : objArray;
    var str = '';

    var headerfields = Object.keys(array[0]);
    var headerline = '';
    for (var key=0;key < headerfields.length;key++) {
        if (headerline != '') headerline += ','
        headerline += "\"" + headerfields[key] + "\"";
    }
    str += headerline + '\r\n';
    
    for (var i = 0; i < array.length; i++) {
        var line = '';
        for (var index in array[i]) {
            if (line != '') line += ','

            line += "\"" + array[i][index] + "\"";
        }

        str += line + '\r\n';
    }

    return str;
}

